import React , {useState, useEffect} from 'react'
import axios from 'axios';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import logo from "../images/Bullbear logo.png"
import "../styles/Searchbar.css"
import Papa from "papaparse";

function Searchbar() {

  function showTickerData(event){
        axios.get('http://127.0.0.1:8000/tickerdata/')
        .then((res)=>{
            console.log(res.data)
            this.setState({Ticker:res.data})
        })
  } showTickerData();

  function handleSignUpClick() {
    window.location.href = '/signup';
  }

  function handleLoginClick() {
    window.location.href = '/login';
  }

  const [options, setOptions] = useState([]);
  const [searchInput, setSearchInput] = useState("");
  const [filteredOptions, setFilteredOptions] = useState([]);

  useEffect(() => {
    Papa.parse("/Users/lordvoldemort/django_react/second_attempt/data/NSE Tickers List.csv", {
      download: true,
      header: true,
      complete: (results) => {
        const options = results.data.map((row) => row.SYMBOL);
        setOptions(options);
      },
    });
  }, []);

  const handleInputChange = (e) => {
    const value = e.target.value.toLowerCase();
    const filtered = options.filter((option) =>
      option.toLowerCase().includes(value)
    );
    setFilteredOptions(filtered);
    setSearchInput(value);
  };

  const handleOptionClick = (option) => {
    setSearchInput(option);
    setFilteredOptions([]);
  };

  return (
    <>
    <div class="navbar">
      <div class="navbar-left">
        <div class="navbar-logo">
          <img src={logo} alt="Company Logo"/>
        </div>
        <a href="/" class="navbar-title">Bulls and Bears</a>
      </div>
      <div class="navbar-right">
        <button class="navbar-button" onClick={handleSignUpClick}>Sign Up</button>
        <button class="navbar-button" onClick={handleLoginClick}>Sign In</button>
      </div>
    </div>
    <h3>Check the Historical Data Analysis here</h3>
    <div className="searchbar">
      <input
        type="text"
        placeholder="Enter your ticker name..."
        value={searchInput}
        onChange={handleInputChange}
        className="searchbar-input"
      />
      {filteredOptions.length > 0 && (
        <div className="options-container">
          {filteredOptions.map((option) => (
            <div
              className="option-item"
              key={option}
              onClick={() => handleOptionClick(option)}
            >
              {option}
            </div>
          ))}
        </div>
      )}
    </div>
    </>
  )
}

export default Searchbar
